import './HodProfile.css';
import React, { useEffect, useState } from 'react';
import Logout from '../Logout/Logout';

const HodProfile = () => {
  const [requests, setRequests] = useState([]);

  useEffect(() => {
    // Fetch the list of requests from the API
    fetch('/api/requests')  // Example endpoint
      .then((response) => response.json())
      .then((data) => setRequests(data))
      .catch((error) => console.error('Error fetching requests:', error));
  }, []);

  const handleApprove = (id) => {
    // Add your approve request logic here
  };

  const handleGenerateReport = () => {
    // Add your generate report logic here
  };

  return (
    <div>
      <h2>HOD Profile</h2>
      <nav>
        <ul>
          <li><a href="/dashboard">Dashboard</a></li>
          <li><button onClick={handleGenerateReport}>Generate Report</button></li>
        </ul>
      </nav>
      <Logout />
      <h3>Pending Requests</h3>
      <ul>
        {requests.map((request) => (
          <li key={request.id}>
            {request.title} - {request.description}
            <button onClick={() => handleApprove(request.id)}>Approve</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default HodProfile;
